import React from 'react';
import './Profile.css';

function Profile() {
  return (
    <div className="user-container">
      <div className="sidebar">
        <ul>
          <li><a href="#user-info">Change Email</a></li>
          <li><a href="#change-email">Change Email</a></li>
          <li><a href="#change-password">Change Password</a></li>
          <li><a href="#add-friend">Add Friend</a></li>
          <li><a href="#friend-list">Friend List</a></li>
          <li><a href="#match-history">Match History</a></li>
        </ul>
      </div>
      <div className="user-info">
        <h2>User Information</h2>
        <p>Username: diaraz</p>
        <p>Email: diaraz@example.com</p>
      </div>
    </div>
  );
}

export default Profile;
